import React from "react";
import TodoItem from "./TodoItem";
import { useSelector }  from "react-redux";
function TodoList() {
  const {list} = useSelector((state)=>state.list)
  return (
    <div className="todo-container">
      <ul className="todo-list">
          <TodoItem items={list}/>
      </ul>
    </div>
  );
}

export default TodoList;
